import React from 'react';
import { motion } from 'framer-motion';
import { 
  Check, Star, BookOpen, Trophy, Users, Clock, 
  Monitor, Coffee, Brain, Rocket, Award, Gift 
} from 'lucide-react';
import Navbar from '../components/common/navbar';
import Footer from '../components/common/Footer';

const StudentSubscription = () => {
  const benefits = [
    {
      icon: BookOpen,
      title: "Akses Penuh ke Semua Materi",
      description: "Jelajahi semua modul pembelajaran dari dasar hingga tingkat lanjut",
      color: "cyan"
    },
    {
      icon: Monitor,
      title: "Live Coding Session",
      description: "Sesi coding langsung dengan mentor berpengalaman setiap minggu",
      color: "blue"
    },
    {
      icon: Users,
      title: "Komunitas Eksklusif",
      description: "Bergabung dengan komunitas developer dan berkolaborasi dalam proyek",
      color: "purple"
    },
    {
      icon: Trophy,
      title: "Sertifikasi Resmi",
      description: "Dapatkan sertifikat resmi setelah menyelesaikan setiap modul",
      color: "yellow"
    },
    {
      icon: Brain,
      title: "Mentoring 1-on-1",
      description: "Konsultasi pribadi dengan mentor untuk membantu pembelajaran Anda",
      color: "pink"
    },
    {
      icon: Rocket,
      title: "Career Support",
      description: "Panduan karir dan akses ke jaringan perusahaan partner",
      color: "green"
    }
  ];

  const plans = [
    {
      name: "Free Trial",
      price: "Rp 0",
      duration: "14 Hari",
      features: [
        "Akses ke modul dasar",
        "Forum komunitas",
        "3 Live coding sessions",
        "Basic exercises"
      ],
      recommended: false,
      buttonText: "Mulai Gratis"
    },
    {
      name: "Student Basic",
      price: "Rp 99.000",
      duration: "per bulan",
      features: [
        "Akses ke semua modul basic",
        "Forum komunitas",
        "Weekly live coding",
        "Basic projects",
        "Basic sertifikasi"
      ],
      recommended: false,
      buttonText: "Pilih Paket"
    },
    {
      name: "Student Pro",
      price: "Rp 199.000",
      duration: "per bulan",
      features: [
        "Semua fitur Basic",
        "Akses semua modul advanced",
        "Unlimited live coding",
        "Advanced projects",
        "1-on-1 mentoring",
        "Career support",
        "Pro sertifikasi"
      ],
      recommended: true,
      buttonText: "Pilih Paket"
    }
  ];

  return (
    <div className="min-h-screen bg-[#0A1525] relative overflow-hidden">
      {/* Background Effects */}
      <div className="absolute inset-0 overflow-hidden pointer-events-none">
        <div className="absolute top-1/4 left-1/4 w-[500px] h-[500px] bg-cyan-500/20 rounded-full blur-3xl animate-pulse"></div>
        <div className="absolute bottom-1/3 right-1/4 w-[500px] h-[500px] bg-blue-500/20 rounded-full blur-3xl animate-pulse delay-1000"></div>
        <div className="absolute top-2/3 left-1/3 w-[500px] h-[500px] bg-purple-500/10 rounded-full blur-3xl animate-pulse delay-[2000ms]"></div>
        <div className="absolute inset-0 bg-[linear-gradient(rgba(6,182,212,0.05)_1px,transparent_1px),linear-gradient(90deg,rgba(6,182,212,0.05)_1px,transparent_1px)] bg-[size:44px_44px]"></div>
      </div>

      <Navbar />

      {/* Hero Section */}
      <section className="relative px-6 pt-32 pb-16">
        <div className="mx-auto text-center max-w-7xl">
          <motion.h1 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="mb-6 text-4xl font-bold text-transparent md:text-5xl bg-gradient-to-r from-white to-gray-300 bg-clip-text"
          >
            Mulai Perjalanan Belajarmu
          </motion.h1>
          <motion.p
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.2 }}
            className="max-w-2xl mx-auto mb-12 text-xl text-gray-400"
          >
            Pilih paket yang sesuai dengan kebutuhanmu dan mulai bangun karirmu sebagai developer profesional
          </motion.p>
        </div>
      </section>

      {/* Benefits Section */}
      <section className="relative px-6 py-16">
        <div className="mx-auto max-w-7xl">
          <motion.h2 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="mb-12 text-3xl font-bold text-center text-white"
          >
            Keuntungan Menjadi Student RT Academy
          </motion.h2>

          <div className="grid gap-8 md:grid-cols-2 lg:grid-cols-3">
            {benefits.map((benefit, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: index * 0.1 }}
                className="p-6 transition-all duration-300 border border-gray-700 bg-gray-800/50 backdrop-blur-sm rounded-xl hover:border-cyan-500/50"
              >
                <div className={`p-3 rounded-lg bg-${benefit.color}-500/10 w-fit mb-4`}>
                  <benefit.icon className={`h-6 w-6 text-${benefit.color}-400`} />
                </div>
                <h3 className="mb-2 text-xl font-semibold text-white">
                  {benefit.title}
                </h3>
                <p className="text-gray-400">
                  {benefit.description}
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Pricing Section */}
      <section className="relative px-6 py-16">
        <div className="mx-auto max-w-7xl">
          <motion.h2 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="mb-12 text-3xl font-bold text-center text-white"
          >
            Pilih Paket Belajarmu
          </motion.h2>

          <div className="grid gap-8 md:grid-cols-3">
            {plans.map((plan, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: index * 0.1 }}
                className={`p-8 rounded-xl border transition-all duration-300 ${
                  plan.recommended
                    ? 'bg-gradient-to-b from-gray-800/80 to-gray-800/50 border-cyan-500 shadow-lg shadow-cyan-500/20'
                    : 'bg-gray-800/50 border-gray-700 hover:border-cyan-500/50'
                }`}
              >
                {plan.recommended && (
                  <div className="mb-4 text-sm font-medium text-cyan-400">Recommended</div>
                )}
                <h3 className="mb-2 text-2xl font-bold text-white">{plan.name}</h3>
                <div className="mb-6">
                  <span className="text-4xl font-bold text-white">{plan.price}</span>
                  <span className="text-gray-400">/{plan.duration}</span>
                </div>
                <ul className="mb-8 space-y-4">
                  {plan.features.map((feature, idx) => (
                    <li key={idx} className="flex items-center text-gray-300">
                      <Check className="w-5 h-5 mr-3 text-cyan-400" />
                      {feature}
                    </li>
                  ))}
                </ul>
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  className={`w-full py-3 px-6 rounded-lg font-medium transition-all duration-300 ${
                    plan.recommended
                      ? 'bg-gradient-to-r from-cyan-500 to-blue-500 text-white hover:opacity-90'
                      : 'bg-gray-700 text-white hover:bg-gray-600'
                  }`}
                >
                  {plan.buttonText}
                </motion.button>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* FAQ Section */}
      <section className="relative px-6 py-16">
